import subprocess

try:
    result = subprocess.run(['df', '-h'], capture_output=True, text=True, check=True)
    disk_space_info = result.stdout
except FileNotFoundError:
    try:
        # For Windows, this command is more complex and might not work directly in all sandbox environments.
        # A simpler approach might be needed or a specific tool if available.
        # As a fallback, attempting a basic PowerShell command.
        result = subprocess.run(['powershell', 'Get-PSDrive C'], capture_output=True, text=True, check=True)
        disk_space_info = result.stdout
    except FileNotFoundError:
        disk_space_info = "Could not determine disk space. Neither 'df -h' nor 'powershell Get-PSDrive C' was found."
except subprocess.CalledProcessError as e:
    disk_space_info = f"Error executing command: {e.stderr}"

return { "disk_space_info_T001": disk_space_info }

